function serializeFormJSON(form) {
    var obj = {};
    var arr = form.serializeArray();
    $.each(arr, function () {
        if (obj[this.name]) {
            if (!obj[this.name].push) {
            obj[this.name] = [obj[this.name]]
            }
            obj[this.name].push(this.value || '')
        } else {
        obj[this.name] = this.value || ''
        }
    })
    return obj
}

