function CorporateActiveStep(step){
    //start 1 ,
    //step value equal number of active step 

    var topMenuLength = $(".nav-top-step").find("div.d-flex").children().length;

    // console.log(topMenuLength)

    for(var i = 0; i < step;i++){
        $(".nav-top-step").find("div.d-flex").children().eq(i).find("button").addClass("active-menu");
        $(".nav-top-step").find("div.d-flex").children().eq(i).find("p").addClass("active-text font-weight-bold");

        if(step > 1){
            if(i < (step-1)){
                $(".nav-top-step").find("div.d-flex").children().eq(i).find("button").empty().append(`<i class="zmdi zmdi-check"></i>`);
            } 
        } 
    }
    if(step !== topMenuLength){
        $(".nav-top-step").find("div.d-flex").children().find("button").not(".active-menu").removeClass("active-menu").addClass("inactive-menu");
        $(".nav-top-step").find("div.d-flex").children().find("p").not(".active-text").removeClass("active-text font-weight-bold").addClass("inactive-text");
    }
    
}
