$(document).ready(function(){
	const path = location.pathname
	var found = false
	var links = []

	// console.log(`current path: ${path}`)

	$('.menu-items').each(function(i) {

		const href = $(this).attr('href')
		if (typeof href === undefined || href === null || href === '') {
			return
		}
		const url = new URL(href)
		// console.log(`element path: ${url.pathname}`)
		
		if (url.pathname === path) {
			$(this).addClass('active')
			sessionStorage.setItem('lastlinkindex', i)
			found = true
			return false
		} else if (path.includes(url.pathname)) {
			links.push({
				index: i,
				link: $(this).attr('href')
			})
		}
	})

	// console.log(links)
	if (found !== true) {
		if (links.length === 0) {
			const index = sessionStorage.getItem('lastlinkindex') || null
			if (index === null) { 
				return 
			}
			$('.menu-items').eq(index).addClass('active')
		} else if (links.length === 1) {
			$('.menu-items').eq(links[0].index).addClass('active')
		}
	}
})

