//check breadcrumb-title
var getTilePage = $("input[name='breadcrumb-title']").val();
$("#breadcrumb-title").text(getTilePage);

function windowSize() {
	windowHeight = window.innerHeight ? window.innerHeight : $(window).height();
	windowWidth = window.innerWidth ? window.innerWidth : $(window).width();
}
windowSize();

if (windowWidth <= 512) {
	$("main[role='main']").attr("style" , "padding-left:0 !important");
	$("#title-header-nav").find(".btn-nav").removeClass("d-none");
	$("#breadcrumb-title").attr("style" , "margin-left:0 !important;padding-left:0!important;");
	$("#top-nav").attr("style" , "margin-left:0 !important;padding-left:0!important;");
	$("#menu").addClass("d-none");
	$("#menu").attr("data-visible" , "invisible");
}
else {
	if ($("#menu").length == 0) {
		$("#top-nav").attr("style" , "margin-left:0 !important;padding-left:0!important;");
		$("main[role='main']").attr("style" , "padding-left:0 !important");
	} else {
		$("main[role='main']").removeAttr("style");
		$("#title-header-nav").find(".btn-nav").addClass("d-none");
		$("#breadcrumb-title").removeAttr("style");
		$("#top-nav").removeAttr("style");
		$("#menu").removeClass("d-none");
		$("#menu").attr("data-visible" , "visible");
	}
	
}

//the current height
$(window).resize(function() {
  windowSize();
  
	if (windowWidth < 1024) {
		// alert("ab")
		// alert(windowWidth + " case min")
		$("main[role='main']").attr("style" , "padding-left:0 !important");
		$("#title-header-nav").find(".btn-nav").removeClass("d-none");
		$("#breadcrumb-title").attr("style" , "margin-left:0 !important;padding-left:0!important;");
		$("#top-nav").attr("style" , "margin-left:0 !important;padding-left:0!important;");

		
		$("#menu").addClass("d-none");
		$("#menu").attr("data-visible" , "invisible");
	} else if (windowWidth > 1024) {
		// alert("cd")
		// alert(windowWidth + " case max")
		if ($("#menu").length == 0) {
			$("#top-nav").attr("style" , "margin-left:0 !important;padding-left:0!important;");
			$("main[role='main']").attr("style" , "padding-left:0 !important");
		} else {
			$("main[role='main']").removeAttr("style");
			$("#title-header-nav").find(".btn-nav").addClass("d-none");
			$("#breadcrumb-title").removeAttr("style");
			$("#top-nav").removeAttr("style");

			$("#menu").removeClass("showNav");
			$("#menu").removeClass("d-none");
			$("#menu").attr("data-visible" , "visible");
		}
	}
});